import React from 'react';

function Resume() {
  const resumeSections = {
    education: [
      {
        degree: 'BSc in Data Science',
        institution: 'Tech University',
        period: '2021 - Present',
        gpa: '3.8/4.0'
      }
    ],
    skills: {
      technical: ['Python', 'R', 'SQL', 'Machine Learning', 'Deep Learning'],
      tools: ['TensorFlow', 'PyTorch', 'Scikit-learn', 'Pandas'],
      soft: ['Problem Solving', 'Team Collaboration', 'Communication']
    },
    experience: [
      {
        role: 'Data Science Intern',
        company: 'Tech Corp',
        period: 'Jan 2024 - Present',
        achievements: [
          'Developed ML models for predictive analytics',
          'Created automated data pipelines',
          'Improved model accuracy by 25%'
        ]
      }
    ]
  };

  return (
    <div className="page-container">
      <h1>Digital <span className="glow-text">Resume</span></h1>
      <div className="content-wrapper">
        <div className="resume-container">
          <div className="resume-header">
            <h2>Education</h2>
            {resumeSections.education.map((edu, index) => (
              <div 
                key={index}
                className="education-card"
                style={{
                  animation: `fadeInLeft ${0.3 + index * 0.1}s ease-out`
                }}
              >
                <h3>{edu.degree}</h3>
                <p>{edu.institution}</p>
                <p>{edu.period}</p>
                <p>GPA: {edu.gpa}</p>
              </div>
            ))}
          </div>

          <div className="skills-section">
            <h2>Skills</h2>
            {Object.entries(resumeSections.skills).map(([category, skills], index) => (
              <div 
                key={category}
                className="skills-category"
                style={{
                  animation: `fadeInRight ${0.3 + index * 0.1}s ease-out`
                }}
              >
                <h3>{category.charAt(0).toUpperCase() + category.slice(1)}</h3>
                <div className="skills-grid">
                  {skills.map((skill, i) => (
                    <span key={i} className="skill-tag">{skill}</span>
                  ))}
                </div>
              </div>
            ))}
          </div>

          <div className="experience-section">
            <h2>Experience</h2>
            {resumeSections.experience.map((exp, index) => (
              <div 
                key={index}
                className="experience-card"
                style={{
                  animation: `fadeInUp ${0.3 + index * 0.1}s ease-out`
                }}
              >
                <h3>{exp.role}</h3>
                <p className="company">{exp.company}</p>
                <p className="period">{exp.period}</p>
                <ul>
                  {exp.achievements.map((achievement, i) => (
                    <li key={i}>{achievement}</li>
                  ))}
                </ul>
              </div>
            ))}
          </div>

          <div className="resume-actions">
            <button className="download-btn">
              Download PDF Version
            </button>
            <button className="print-btn">
              Print Resume
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Resume;
